        <div className="max-w-[1240px] mx-auto grid md:grid-cols-3 gap-8">
            <div className="w-full shadow-xl flex flex-col p-4 my-4 rounded-lg hover:scale(105)">  </div> 
            <img className="w-20 mx-auto mt-[-3rem] bg-white" src={cm1} all="/" />
            <h2 className="text-2xl font-bold text-center py-8">  </h2>
        </div>

    </div>
    
    )
}

export default List
